# Import necessary modules from Selenium and other libraries
from typing import List, Dict
from selenium.webdriver import ChromeOptions, Chrome
from selenium.webdriver.common.by import By
from selenium.webdriver.support import expected_conditions as EC
from selenium.webdriver.support.wait import WebDriverWait
from selenium.webdriver.chrome.service import Service as ChromeService
from webdriver_manager.chrome import ChromeDriverManager
from selenium.common.exceptions import NoSuchElementException, TimeoutException


options = ChromeOptions()

options.add_argument("--start-maximized")
options.add_experimental_option("excludeSwitches", ["enable-automation"])
options.add_argument("--user-agent=Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/112.0.0.0 Safari/537.36")

driver = Chrome(service=ChromeService(ChromeDriverManager().install()), options=options)

url = "https://www.medicus-online.at/aek/dist/medicus-suche-angestellte"

driver.get(url)
wait = WebDriverWait(driver, 10)

# Execute JavaScript to scroll the page down by 500 pixels
driver.execute_script("window.scrollBy(0, 500);")


def get_doctors(district: str)-> List[Dict]:
    """
    Scrape and retrieve information about doctors in a specific district.

    Parameters:
        district (str): The name of the district to search for doctors.

    Returns:
        list: A list of dictionaries, where each dictionary contains the following information:
            - 'name': The name of the doctor.
            - 'title': The job title or position of the doctor.
            - 'address': The address of the doctor's practice.
            - 'phone': The contact phone number of the doctor's practice.
            - 'mail': The contact email address of the doctor's practice.
    """
    # Click on the district select element to open the options
    wait.until(EC.presence_of_element_located((By.ID, 'bezirk-custom-select'))).click()

    # using CSS selector
    # wait.until(EC.presence_of_element_located((By.CSS_SELECTOR, 'div#bezirk-custom-select>div>span:nth-child(2)'))).click()

    # Select the provided district from the dropdown options
    wait.until(EC.presence_of_element_located((By.XPATH, f'//div[@id="bezirk-custom-select"]/div/span[text()="{district}"]'))).click()

    # Initialize an empty list to store the scraped doctors' data
    doctors_data = []
    try:
        # Find all elements that represent doctors on the page
        doctors = wait.until(EC.presence_of_all_elements_located((By.CSS_SELECTOR, 'div[id^="arzt-"]')))
        print(f"total number of doctors: {len(doctors)}")

        # Iterate through each doctor element and extract relevant data
        for doctor in doctors:
            try:
                name = doctor.find_element(By.CSS_SELECTOR, 'p.h4.mb-0').text
            except NoSuchElementException:
                name = None

            try:
                title = doctor.find_element(By.CSS_SELECTOR, 'p.jobTitle').text
            except NoSuchElementException:
                title = None

            try:
                address = doctor.find_element(By.CSS_SELECTOR, 'div.address').text
            except NoSuchElementException:
                address = None

            try:
                phone = doctor.find_element(By.CSS_SELECTOR, 'a[href^="tel:"]').text
            except NoSuchElementException:
                phone = None

            try:
                mail = doctor.find_element(By.CSS_SELECTOR, 'a[href^="mailto:"]').text
            except NoSuchElementException:
                mail = None

            # Add the extracted data to the doctors_data list as a dictionary
            doctors_data.append({
                "name": name,
                "title": title,
                "address": address,
                "phone": phone,
                "mail": mail
            })

    except TimeoutException:
        # If a timeout occurs, handle it gracefully (e.g., ignore it)
        pass

    return doctors_data

# Entry point of the script
if __name__ == "__main__":
    # Call the get_doctors function and print the doctor's list for a specific district
    print(get_doctors(district="Bezirk Bludenz"))

